// This is code accompanying the paper "Explicit construction of Kummer surfaces in characterstic 2 via specialisation"

// There are no checks in this file, so be aware that you are likely to get wrong output if you add incorrect input.

// The functions GeneralKummerSurface and Kappa have been mostly copied from the code of the article by Steffen Muller to whom I thank. I have included them because they constituted the basis of most of the code I wrote.

// In terms of notation, an important point is that J will be used when referring to Jacobians of a genus 2 curves as implemented in MAGMA, and Jac will refer to the model of the Jacobian as 72 equations in P^15.

// If you find any bug or mistake, or if you have any question, please don't hesitate in contacting me :)
// email: alvaro.gohe@gmail.com

// This function takes any hyperelliptic genus 2 curve and transforms it into one of the form y^2+g(x)y=f(x) with deg(g)=3.
function GenusTwoModel(C)
 k := BaseRing(C);
 K<x> := PolynomialRing(k); // Originally I had this line in the code, but I had changed it, since sometimes it changed the model of very perfectly valid curves into worse models
 // if Type(k) eq FldRat then 
  // Cint := ReducedMinimalWeierstrassModel(C);
  // f,g := HyperellipticPolynomials(Cint);
  // else 
  f,g := HyperellipticPolynomials(C);
 // end if;
 f0 := Coefficient(f,0);
 f1 := Coefficient(f,1);
 f2 := Coefficient(f,2);
 f3 := Coefficient(f,3);
 f4 := Coefficient(f,4);  
 f5 := Coefficient(f,5);
 f6 := Coefficient(f,6);
 g0 := Coefficient(g,0);
 g1 := Coefficient(g,1);
 g2 := Coefficient(g,2);
 g3 := Coefficient(g,3);
 if g eq 0 then
  g := 2*x^3;
  f := f - x^6;
  else
  if g3 eq 0 then
   if g0 ne 0 then
     g := g3 + g2*x + g1*x^2 + g0*x^3;
     f := f6 + f5*x + f4*x^2 + f3*x^3 + f2*x^4 + f1*x^5 + f0*x^6;
     else 
     if g0+g1+g2+g3 ne 0 then
      g := -g0 + 3*g0*x + g1*x - 3*g0*x^2 - 2*g1*x^2 - g2*x^2 + g0*x^3 + g1*x^3 + g2*x^3 + g3*x^3;
      f := f0 - 6*f0*x - f1*x + 15*f0*x^2 + 5*f1*x^2 + f2*x^2 -   20*f0*x^3 - 10*f1*x^3 - 4*f2*x^3 - f3*x^3 + 15*f0*x^4 +   10*f1*x^4 + 6*f2*x^4 + 3*f3*x^4 + f4*x^4 - 6*f0*x^5 -   5*f1*x^5 - 4*f2*x^5 - 3*f3*x^5 - 2*f4*x^5 - f5*x^5 + f0*x^6 +   f1*x^6 + f2*x^6 + f3*x^6 + f4*x^6 + f5*x^6 + f6*x^6;
      else
      if Characteristic(k) ne 2 then
       g :=  g0 + 3*g0*x - g1*x + 3*g0*x^2 - 2*g1*x^2 + g2*x^2 + g0*x^3 - g1*x^3 + g2*x^3 - g3*x^3;
       f := f0 + 6*f0*x - f1*x + 15*f0*x^2 - 5*f1*x^2 + f2*x^2 + 20*f0*x^3 - 10*f1*x^3 + 4*f2*x^3 - f3*x^3 + 15*f0*x^4 - 10*f1*x^4 + 6*f2*x^4 - 3*f3*x^4 + f4*x^4 + 6*f0*x^5 - 5*f1*x^5 + 4*f2*x^5 - 3*f3*x^5 + 2*f4*x^5 - f5*x^5 + f0*x^6 - f1*x^6 + f2*x^6 - f3*x^6 + f4*x^6 - f5*x^6 + f6*x^6;
       else if IsFinite(k) and #k eq 2 then
        error "The base field does not have enough elements to transform this curve to one of the form y^2+g(x)y=f(x) with deg(g)=3. How about you make a field extension?";
        else t := k.1;
        g := g0*t^3 + 3*g0*t^2*x + g1*t^3*x + 3*g0*t*x^2 + 2*g1*t^2*x^2 + g2*t^3*x^2 + g0*x^3 + g1*t*x^3 + g2*t^2*x^3 + g3*t^3*x^3;
        f := f0*t^6 + 6*f0*t^5*x + f1*t^6*x + 15*f0*t^4*x^2 + 5*f1*t^5*x^2 +  f2*t^6*x^2 + 20*f0*t^3*x^3 + 10*f1*t^4*x^3 + 4*f2*t^5*x^3 + f3*t^6*x^3 + 15*f0*t^2*x^4 + 10*f1*t^3*x^4 + 6*f2*t^4*x^4 + 3*f3*t^5*x^4 + f4*t^6*x^4 + 6*f0*t*x^5 + 5*f1*t^2*x^5 + 4*f2*t^3*x^5 + 3*f3*t^4*x^5 + 2*f4*t^5*x^5 + f5*t^6*x^5 + f0*x^6 + f1*t*x^6 + f2*t^2*x^6 + f3*t^3*x^6 + f4*t^4*x^6 + f5*t^5*x^6 + f6*t^6*x^6;
       end if;
      end if;
   end if;
  end if;
  end if;
 end if;
return HyperellipticCurve(f,g);
end function;

// Given a genus 2 curve, this function computes the associated Kummer surface.
function GeneralKummerSurface(C)
 return GeneralKummerSurface(Jacobian(C));
end function;

// Given the Jacobian corresponding to a genus 2 curve, this function computes the associated Kummer surface. This code was written by Muller, and I have only changed a few bits, mainly to uniform notation.
function GeneralKummerSurface(J)
 C :=  GenusTwoModel(Curve(J));
 k := BaseRing(C);
 f,g := HyperellipticPolynomials(C);
 P<k1,k2,k3,k4> := ProjectiveSpace(k,3);
 f0 := Coefficient(f,0);
 f1 := Coefficient(f,1);
 f2 := Coefficient(f,2);
 f3 := Coefficient(f,3);
 f4 := Coefficient(f,4);  
 f5 := Coefficient(f,5);
 f6 := Coefficient(f,6);
 g0 := Coefficient(g,0);
 g1 := Coefficient(g,1);
 g2 := Coefficient(g,2);
 g3 := Coefficient(g,3);
  eqKum := f1^2*k1^4 - 4*f0*f2*k1^4 - f2*g0^2*k1^4 + f1*g0*g1*k1^4 - f0*g1^2*k1^4 - 4*f0*f3*k1^3*k2 - f3*g0^2*k1^3*k2 + f1*g0*g2*k1^3*k2 - 2*f0*g1*g2*k1^3*k2 - 4*f0*f4*k1^2*k2^2 - f4*g0^2*k1^2*k2^2 - f0*g2^2*k1^2*k2^2 + f1*g0*g3*k1^2*k2^2 - 2*f0*g1*g3*k1^2*k2^2 - 4*f0*f5*k1*k2^3 - f5*g0^2*k1*k2^3 - 2*f0*g2*g3*k1*k2^3 - 4*f0*f6*k2^4 - f6*g0^2*k2^4 - f0*g3^2*k2^4 - 2*f1*f3*k1^3*k3 - f3*g0*g1*k1^3*k3 + 2*f2*g0*g2*k1^3*k3 - f1*g1*g2*k1^3*k3 - f1*g0*g3*k1^3*k3 + 2*f0*g1*g3*k1^3*k3 - 4*f1*f4*k1^2*k2*k3 + 4*f0*f5*k1^2*k2*k3 + f5*g0^2*k1^2*k2*k3 - 2*f4*g0*g1*k1^2*k2*k3 + f3*g0*g2*k1^2*k2*k3 - f1*g2^2*k1^2*k2*k3 + 2*f2*g0*g3*k1^2*k2*k3 - f1*g1*g3*k1^2*k2*k3 + 2*f0*g2*g3*k1^2*k2*k3 - 4*f1*f5*k1*k2^2*k3 + 8*f0*f6*k1*k2^2*k3 + 2*f6*g0^2*k1*k2^2*k3 - 2*f5*g0*g1*k1*k2^2*k3 + f3*g0*g3*k1*k2^2*k3 - 2*f1*g2*g3*k1*k2^2*k3 + 2*f0*g3^2*k1*k2^2*k3 - 4*f1*f6*k2^3*k3 - 2*f6*g0*g1*k2^3*k3 - f1*g3^2*k2^3*k3 + f3^2*k1^2*k3^2 - 4*f2*f4*k1^2*k3^2 + 2*f1*f5*k1^2*k3^2 - 4*f0*f6*k1^2*k3^2 - f6*g0^2*k1^2*k3^2 + f5*g0*g1*k1^2*k3^2 - f4*g1^2*k1^2*k3^2 + f3*g1*g2*k1^2*k3^2 - f2*g2^2*k1^2*k3^2 + f3*g0*g3*k1^2*k3^2 + f1*g2*g3*k1^2*k3^2 - f0*g3^2*k1^2*k3^2 - 4*f2*f5*k1*k2*k3^2 + 4*f1*f6*k1*k2*k3^2 + 2*f6*g0*g1*k1*k2*k3^2 - f5*g1^2*k1*k2*k3^2 - f5*g0*g2*k1*k2*k3^2 + 2*f4*g0*g3*k1*k2*k3^2 + f3*g1*g3*k1*k2*k3^2 - 2*f2*g2*g3*k1*k2*k3^2 + f1*g3^2*k1*k2*k3^2 - 4*f2*f6*k2^2*k3^2 - f6*g1^2*k2^2*k3^2 - 2*f6*g0*g2*k2^2*k3^2 + f5*g0*g3*k2^2*k3^2 - f2*g3^2*k2^2*k3^2 - 2*f3*f5*k1*k3^3 + 2*f6*g0*g2*k1*k3^3 - f5*g1*g2*k1*k3^3 - f5*g0*g3*k1*k3^3 + 2*f4*g1*g3*k1*k3^3 - f3*g2*g3*k1*k3^3 - 4*f3*f6*k2*k3^3 - 2*f6*g1*g2*k2*k3^3 + f5*g1*g3*k2*k3^3 - f3*g3^2*k2*k3^3 + f5^2*k3^4 - 4*f4*f6*k3^4 - f6*g2^2*k3^4 + f5*g2*g3*k3^4 - f4*g3^2*k3^4 - 4*f0*k1^3*k4 - g0^2*k1^3*k4 - 2*f1*k1^2*k2*k4 - g0*g1*k1^2*k2*k4 - g0*g2*k1*k2^2*k4 - g0*g3*k2^3*k4 - 4*f2*k1^2*k3*k4 - g1^2*k1^2*k3*k4 + 2*g0*g2*k1^2*k3*k4 - 2*f3*k1*k2*k3*k4 - g1*g2*k1*k2*k3*k4 + 3*g0*g3*k1*k2*k3*k4 - g1*g3*k2^2*k3*k4 - 4*f4*k1*k3^2*k4 - g2^2*k1*k3^2*k4 + 2*g1*g3*k1*k3^2*k4 - 2*f5*k2*k3^2*k4 - g2*g3*k2*k3^2*k4 - 4*f6*k3^3*k4 - g3^2*k3^3*k4 + k2^2*k4^2 - 4*k1*k3*k4^2;
 S := Surface(P, eqKum);
 return S; 
end function;

// Given a genus 2 curve, this function computes the associated Jacobian surface embedded in P^15.
function GeneralJacobianSurface(C)
 return GeneralJacobianSurface(Jacobian(C));
end function;

// Given the Jacobian corresponding to a genus 2 curve, this function computes the associated Jacobian surface embedded in P^15. The equations have been computed in the Mathematica notebook titled Part 2, and the equations are also independently in the text file "72 equations of the Jacobian.txt".
function GeneralJacobianSurface(J)
 C := GenusTwoModel(Curve(J));
 k := BaseRing(C);
 f,g := HyperellipticPolynomials(C);
 P15<v1, v2, v3, v4, v5, v6, k11, k12, k13, k14, k22, k23, k24, k33, k34, k44> := ProjectiveSpace(k,15); 
 f0 := Coefficient(f,0);
 f1 := Coefficient(f,1);
 f2 := Coefficient(f,2);
 f3 := Coefficient(f,3);
 f4 := Coefficient(f,4);  
 f5 := Coefficient(f,5);
 f6 := Coefficient(f,6);
 g0 := Coefficient(g,0);
 g1 := Coefficient(g,1);
 g2 := Coefficient(g,2);
 g3 := Coefficient(g,3);
