function CoordinatesProjectionToKummer(P) // This function allows us to project points in the projective model of the Jacobian into the projective model of the Kummer.
  if P[7] ne 0 then
   k1 := P[7];
   k2 := P[8];
   k3 := P[9];
   k4 := P[10];
  else 
   k1 := 0;
   if P[11] ne 0 then
    k2 := P[11];
    k3 := P[12];
    k4 := P[13];
    else 
    k2 := 0;
    if P[14] ne 0 then
     k3 := P[14];
     k4 := P[15];
     else
     k3 := 0;
     k4 := P[16];
     end if;
    end if;
   end if;
 return [k1,k2,k3,k4];
end function;

