 T1 := Scheme(Des,[a1*b1 + b2, a1^2*b1 + b3, b4 + b1*y1, b6 + a1*b5*g3^2 + b1*f1*g3^2 + a1^2*b1*f3*g3^2 + a1^4*b1*f5*g3^2 + a1^5*b1*g3^4]);
 T2 := Scheme(Des,[a2*b1 + b2, a2^2*b1 + b3, b4 + b1*y2, b6 + a2*b5*g3^2 + b1*f1*g3^2 + a2^2*b1*f3*g3^2 + a2^4*b1*f5*g3^2 + a1^2*a2^3*b1*g3^4 + a1*a2^4*b1*g3^4 + a2^5*b1*g3^4 + a1^2*b1*g3^3*y2 + a2^2*b1*g3^3*y2]);
 planes := Scheme(Des, [(a1 + a2)*b4 + b2*(y1 + y2) + b1*(a2*y1 + a1*y2), a1*a2*b1 + (a1 + a2)*b2 + b3]);
 return [EO,E12], [T1,T2], planes;
 end function;

 function LinesSupersingular(J,Des) // This function computes the lines when the characteristic 2 and the curve is supersingular. In this case there is only one exceptional lines and one trope which are defined over the base field. All the lines lie in a codimension 3 linear subspace, so this function also returns it.
 C := Curve(J);
 k := BaseRing(C);
 f,g := HyperellipticPolynomials(C);
 P5<b1, b2, b3, b4, b5, b6> := AmbientSpace(Des); 
 f0 := Coefficient(f,0);
 f1 := Coefficient(f,1);
 f2 := Coefficient(f,2);
 f3 := Coefficient(f,3);
 f4 := Coefficient(f,4);  
 f5 := Coefficient(f,5);
 f6 := Coefficient(f,6);
 g0 := Coefficient(g,0);
 g1 := Coefficient(g,1);
 g2 := Coefficient(g,2);
 g3 := Coefficient(g,3);
 a1 := g2/g3;
 y1 := Sqrt(Evaluate(f,a1));
 EO := Scheme(Des,[b1,b2,b3,b4]);
 T1 := Scheme(Des,[a1*b1 + b2, a1^2*b1 + b3, b4 + b1*y1, b6 + a1*b5*g3^2 + b1*f1*g3^2 + a1^2*b1*f3*g3^2 + a1^4*b1*f5*g3^2 + a1^5*b1*g3^4]);
 plane := Scheme(Des,[b4 + b1*y1, a1*b1 + b2, a1^2*b1 + b3]);
 return [EO], [T1], plane;
 end function;

 function Lines(J, Des0) // This function takes a Jacobian and the desingularised model of its associated Kummer and returns a list with the exceptional lines, a list with the tropes and possibly a bit more data (this depends on whether the characteristic of the field is 2, and what the p-rank is). 
 k := BaseRing(Des0);
 if Characteristic(k) ne 2 then
  return LinesNotCharacteristic2(J,Des0);
  else 
   C := Curve(J);
   f,g := HyperellipticPolynomials(C);
   g0 := Coefficient(g,0);
   g1 := Coefficient(g,1);
   g2 := Coefficient(g,2);
   g3 := Coefficient(g,3);
   if g1*g2 + g0*g3 ne 0 then // g1*g2 + g0*g3 is the discriminant of g(x), therefore if it is not zero, then g has 3 different roots and the curve is ordinary.
    return LinesOrdinary(J,Des0);
    else if g2^2 + g1*g3 ne 0 then // if g2^2 + g1 g3 is zero, then the 3 roots are the same, so this makes the distinction between the almost ordinary and the       supersingular cases.
     return LinesAlmostOrdinary(J, Des0);
     else return LinesAlmostOrdinary(J, Des0);
    end if;
   end if;
 end if;
end function;

