*b2^2*b3^2*f4*g2*g3^2 +  b1*b3^3*f4*g2*g3^2 - b2*b3^3*f5*g2*g3^2 + 2*b3^4*f6*g2*g3^2 -  b1*b2^2*b4*g0*g2*g3^2 - b1^2*b3*b4*g0*g2*g3^2 - b2^3*b4*g1*g2*g3^2 -  b1*b2*b3*b4*g1*g2*g3^2 - b2^2*b3*b4*g2^2*g3^2 + 3*b2*b3*b4^2*g3^3 +  2*b1*b2^3*f0*g3^3 - 3*b1^2*b2*b3*f0*g3^3 + b2^4*f1*g3^3 -  b1*b2^2*b3*f1*g3^3 - b1^2*b3^2*f1*g3^3 + b2^3*b3*f2*g3^3 -  2*b1*b2*b3^2*f2*g3^3 - b1*b3^3*f3*g3^3 - b2*b3^3*f4*g3^3 - b3^4*f5*g3^3 +  b2^3*b4*g0*g3^3 - 3*b1*b2*b3*b4*g0*g3^3 - b2^2*b3*b4*g1*g3^3 -  b1*b3^2*b4*g1*g3^3 - 2*b2*b3^2*b4*g2*g3^3 - b3^3*b4*g3^4;
